\begin{abstract}
Synthetic PolyRule Reasoning (SPR) tasks involve classifying sequences of abstract symbols according to hidden rules. We explore whether contextual embeddings, originally designed for language processing, can be adapted to SPR. By leveraging a transformer-based architecture, we investigate whether modeling sequence dependencies improves performance on a standard SPR benchmark (SPR\_BENCH). Our experiments reveal that while training accuracy can rise steadily, validation and test macro-F1 scores plateau around 0.80, mirroring the existing state-of-the-art. These inconclusive yet instructive findings provide insights into how embedding strategies may benefit symbolic tasks, but challenges remain in bridging the gap between natural language and symbolic domains.
\end{abstract}

\section{Introduction}
Recent advances in neural architectures, especially the transformer \citep{vaswani2017attentionia}, have substantially improved performance across natural language tasks. Contextual embeddings \citep{ethayarajh2019howca} capture rich sequence dependencies, usually in word- or subword-based contexts. However, applying such embeddings to purely symbolic reasoning tasks is largely unexplored, leaving open questions about overfitting and the role of symbolic structure.

This work studies Synthetic PolyRule Reasoning (SPR), where each sequence is composed of abstract tokens and assigned a label based on latent logical predicates. The benchmark SPR\_BENCH is representative of intricate symbolic tasks: shape-count, color-position, parity, and other pattern-based rules. Current transformer-based models achieve around 80.0\% accuracy on SPR\_BENCH, suggesting opportunities for further gains but also presenting risk of overfitting.

We propose and investigate an approach to integrate contextual embeddings into SPR classification. We compare simple supervised baselines to a two-stage procedure involving causal language model pretraining. The outcomes help us identify pitfalls, including overfitting when training beyond roughly 10 epochs. We achieve roughly 0.80 macro-F1 on the test set across multiple configurations, shedding light on both successes and limitations of adapting contextual embeddings to SPR.

\section{Related Work}
Many reasoning approaches utilize end-to-end neural methods or explicit symbolic logic. Modern transformers have demonstrated generalized pattern recognition capabilities \citep{vaswani2017attentionia}, but they are rarely studied on purely symbolic tasks of this nature. Contextual embeddings \citep{ethayarajh2019howca} effectively capture local and global dependencies in language. Meanwhile, interpretability and rule-based reasoning have been explored in neural-symbolic frameworks \citep{barbiero2023interpretablenc}, though bridging these concepts with contextual embeddings for strictly symbolic data remains challenging. Our exploration builds upon these directions, seeking robust model configurations while exposing limitations in performance gains.

\section{Method}
We adopt a transformer-based model to classify sequences of discrete symbols. A character-level vocabulary is built from the training set. Each symbol is mapped to an embedding learned alongside positional encodings. The model is configured with a few encoder layers. In one setup, we train directly on classification. In another, we first pretrain the encoder as a causal language model, learning next-token predictions without any labels. We then transfer weights to a classification head. This approach is intended to teach the encoder contextual relationships in an unsupervised manner, hoping to improve final performance.

\section{Experiments}
We use the SPR\_BENCH corpus, partitioned into train, dev, and test splits (20k, 5k, 10k). We tokenize sequences at character-level and constrain sequence length to 128. We train baseline classification models using 5, 10, 20, or 30 epochs with early stopping. Two metrics are tracked: cross-entropy loss and macro-F1. We observe overfitting for higher epoch counts, with validation macro-F1 declining past 10--15 epochs. The final test macro-F1 remains around 0.79--0.80. A further attempt involving a two-stage transformer pretraining yields similar test results, suggesting that capturing symbolic dependencies might be more challenging than capturing linguistic structure.

