Negative findings revolve around limited gains from extended training and the mismatch between symbolic and linguistic structures. Although pretraining stabilizes early learning, final improvements remain marginal. Our results encourage careful regularization or specialized architectures for symbolic tasks.

\section{Conclusion}
We investigated using contextual embeddings for complex symbolic rule reasoning on the SPR\_BENCH benchmark. Despite promising transformer-based methods, test performances plateaued around 0.80 macro-F1, aligning with the existing state-of-the-art. Extended training frequently overfits, and a two-stage pretraining strategy did not yield substantial gains. The inconclusive outcome underscores the need for more specialized representations when transitioning from natural language to symbolic sequences. Future work may explore domain-specific embedding layers or hybrid neural-symbolic designs to surpass current plateaus.

