\section{Introduction}
Recent advances in neural architectures, especially the transformer \citep{vaswani2017attentionia}, have substantially improved performance across natural language tasks. Contextual embeddings \citep{ethayarajh2019howca} capture rich sequence dependencies, usually in word- or subword-based contexts. However, applying such embeddings to purely symbolic reasoning tasks is largely unexplored, leaving open questions about overfitting and the role of symbolic structure.

This work studies Synthetic PolyRule Reasoning (SPR), where each sequence is composed of abstract tokens and assigned a label based on latent logical predicates. The benchmark SPR\_BENCH is representative of intricate symbolic tasks: shape-count, color-position, parity, and other pattern-based rules. Current transformer-based models achieve around 80.0\% accuracy on SPR\_BENCH, suggesting opportunities for further gains but also presenting risk of overfitting.

